function App() {
  
  return (
    <BrowserRouter >
    <div className="App">
      <Routes>
      <Route exact path = "/" element={<LandingPage/>}></Route>
        <Route  path = "/home" element={<Home/>}></Route>
        

      </Routes> 
    </div>
    </BrowserRouter>
